import React from 'react';
import './index.css';
// <%=require('./images/logo.svg')%>

function App() {
    return ( 
    <>
        <header className="header">
            <img className="header__logo" src="<%=require('./images/logo.svg')%>" alt="Around the U.S." />
        </header>
    </>
    );
}

export default App;
